const initialState = 0;
export const Reducer = (state = initialState, action) => {
  switch (action.type) {
    case "Increment":
      return state + 1;
    case "Decrement":
      return state - 1;
    default:
      return state;
  }
};

export const getdataReducer = (state = initialState, action) => {
  console.log(action.payload)
  switch (action.type) {
    case "getdata":
      return action.payload;
   
    default:
      return state;
  }
};
